import React from 'react';
import { Link } from 'react-router-dom';

/**
* @author
* @function Header
**/

export const Header = (props) => {
    return (
        <header class="header">
            <Link>Home</Link>
            <Link>Bollywood</Link>
            <Link>Hollywood</Link>
            <Link>Technology</Link>
      </header>
   )

}
 
export default Header;
